import '../css/style.scss';
import Navigation from '../component/Navigation';

import ServiceBackground from '../../../shared/images/service/service-background.png'

const Service = () => {
  return (
    <div className="elysia">
      <section className="service" style={{ backgroundImage: `url(${ServiceBackground})` }}>
        <Navigation />
        <h1 className="service__title-text">The Liquidity Protocol</h1>
        <h1 className="service__title-text--blue">?COMING SOON</h1>
        <p className="service__subtitle-text">ELYFI is an open source and non-custodial liquidity protocol for earning interest on deposits and borrowing assets.</p>
      </section>
    </div>
  );
}

export default Service;
